import { pads } from "../data";
import Pad from "./Pad";

export default function Home() {
  const padsMapped = pads.map((pad, key) => {
    return <Pad />;
  });
  return (
    <div className="web-body">
        <section className="action-area"></section>
      <section className="pads-container">{padsMapped}</section>
    </div>
  );
}
